import React, {Component} from 'react';
import {BrowserRouter, Route } from 'react-router-dom';

class Home extends Component {
  render(){
    return (
      <BrowserRouter>
        <div className="App">
          <Nav />
          <Route path="/" component={Home}/>
        </div>
      </BrowserRouter>
    );
  }
}

export default Home;
